// src/app/predict-land/predict-land.component.ts
import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';

import { switchMap }         from 'rxjs/operators';
import { CurrencyService } from 'src/app/Services/currency.service';
import { PredictionService } from 'src/app/Services/prediction.service';

@Component({
  selector: 'app-predict-land',
  templateUrl: './predict-land.component.html',
  styleUrls: ['./predict-land.component.scss']
})
export class PredictLandComponent {
  year!: number;
  stateEncoded!: number;
  landUseEncoded!: number;

  predictedUSD: number | null = null;
  predictedTND: number | null = null;
  predicting    = false;
  loadingRate   = false;
  rateError     = false; // Added rateError property

  private inputDim = 25;

  constructor(
    private predictionService: PredictionService,
    private currencyService:   CurrencyService
  ) {}

  onSubmit(form: NgForm) {
    if (form.invalid) return;

    // Reset everything
    this.predictedUSD = null;
    this.predictedTND = null;
    this.predicting   = true;
    this.loadingRate  = false;

    // Build your feature vector
    const zeros = Array(this.inputDim - 3).fill(0);
    const features = [ this.year, this.stateEncoded, this.landUseEncoded, ...zeros ];

    // 1) Predict USD, then 2) fetch rate, then compute TND
    this.predictionService.predict(features).pipe(
      switchMap(({ predicted_price }) => {
        this.predictedUSD = predicted_price;
        this.loadingRate  = true;
        return this.currencyService.getUsdToTndRate();
      })
    )
    .subscribe({
      next: rate => {
        this.predictedTND = this.predictedUSD! * rate;
        this.loadingRate  = false;
        this.predicting   = false;
      },
      error: err => {
        console.error('Error in prediction or rate fetch', err);
        this.loadingRate  = false;
        this.predicting   = false;
      }
    });
  }
}
<div class="container p-4">
  <h2>Land Price Prediction</h2>

  <form #predictForm="ngForm" (ngSubmit)="onSubmit(predictForm)">
    <!-- Year -->
    <div class="mb-3">
      <label for="year">Year</label>
      <input
        id="year"
        name="year"
        type="number"
        required
        class="form-control"
        [(ngModel)]="year"
        #yearCtrl="ngModel"
      />
      <div *ngIf="yearCtrl.invalid && yearCtrl.touched" class="text-danger">
        Year is required.
      </div>
    </div>

    <!-- State_encoded -->
    <div class="mb-3">
      <label for="state">State (encoded)</label>
      <input
        id="state"
        name="state"
        type="number"
        required
        class="form-control"
        [(ngModel)]="stateEncoded"
        #stateCtrl="ngModel"
      />
      <div *ngIf="stateCtrl.invalid && stateCtrl.touched" class="text-danger">
        State encoding is required.
      </div>
    </div>

    <!-- Land_use_encoded -->
    <div class="mb-3">
      <label for="landUse">Land Use (encoded)</label>
      <input
        id="landUse"
        name="landUse"
        type="number"
        required
        class="form-control"
        [(ngModel)]="landUseEncoded"
        #landUseCtrl="ngModel"
      />
      <div *ngIf="landUseCtrl.invalid && landUseCtrl.touched" class="text-danger">
        Land-use encoding is required.
      </div>
    </div>

    <button
      type="submit"
      class="btn btn-primary"
      [disabled]="predictForm.invalid || predicting"
    >
      {{ predicting ? 'Predicting…' : 'Predict Price' }}
    </button>
  </form>

  <!-- USD & TND results -->
  <div *ngIf="predictedUSD !== null" class="alert alert-success mt-4">
    <p>
      <strong>Price (USD/m²):</strong>
      {{ predictedUSD | number:'1.2-2' }}
    </p>
    <p>
      <strong>Price (TND/m²):</strong>
      <!-- show loading spinner/text while fetching -->
      <ng-container *ngIf="loadingRate; else tndResult">
        <em>Loading conversion…</em>
      </ng-container>
      <!-- once rate fetch completes -->
      <ng-template #tndResult>
        <!-- if we got a valid conversion -->
        <span *ngIf="!rateError && predictedTND !== null">
          {{ predictedTND | number:'1.2-2' }}
        </span>
        <!-- if conversion failed -->
        <span *ngIf="rateError" class="text-danger">
          Conversion failed.
        </span>
      </ng-template>
    </p>
  </div>

  <!-- overall prediction error -->
  <div
    *ngIf="!predicting && predictedUSD===null && predictForm.submitted"
    class="alert alert-danger mt-4"
  >
    Prediction failed. Please try again.
  </div>
</div>
